css:
@-moz-document domain("ingenieria.usac.edu.gt") {
body {
    margin: 0;
    font-family: Nunito, sans-serif;
    font-size: -0.125rem;
    font-weight: 400;
    line-height: 1.5;
    color: #FBFDFC;
    text-align: left;
    background-image: url(https://technohoop.com/wp-content/uploads/2021/06/Lets-talk-about-the-great-wallpapers-in-Windows-11-930x620.jpg);
    background-size: cover;
}
.btn-group-lg>.btn, .btn-lg {
    padding: 0.5rem 1rem;
    font-size: 1.25rem;
    line-height: 1.5;
    border-radius: 1.2rem;
}
.btn-primary {
    color: #fff;
    background-color: #21bb944d;
    border-color: #dee9f3;
}
.topbar-dark .navbar-custom {
    background-color: #2e345617!important;
}
.bg-primary {
    background-color: #32a7b187!important;
}
.bg-white {
    background-color: #0e0e0e91!important;
}
.h1, .h2, .h3, .h4, .h5, .h6, h1, h2, h3, h4, h5, h6 {
    margin: 10px 0;
    font-weight: 500;
    font-family:"Cerebri Sans,sans-serif";
    color: #00ffff;
}
}
